import React from 'react';
import styled from 'styled-components';
import { Container} from 'react-bootstrap'

const Style=styled.h2`

	margin:20% 36%;
	color:red;
	font:7vh 'Lobster';

`;

function NoMatch() {
	return(
		<Container>
		<Style>
		<h2>404:Not Found</h2>
		</Style>
		</Container>
		);
}

export default NoMatch;
